### Problem06

What does the following code fragment print when n is 50? 


```java
Stack<Integer> stack = new Stack<Integer>();
while (n > 0)
{
    stack.push(n % 2);
    n /= 2;
}
while (!stack.isEmpty())
    StdOut.print(stack.pop());
StdOut.println();
```
Answer: _____(0)\___.
